import React, { useState, useEffect, useRef } from "react";
import { TodoType } from "./todoGrup";
import axios from "axios";
import { Dialog, Transition } from "@headlessui/react";
import { ExclamationTriangleIcon } from "@heroicons/react/24/outline";
const User = () => {
  const [newTodo, setNewTodo] = useState({
    kullaniciAd: "",
     group:"",
     is:""
  });
  const handleInputChange=(event:any)=>{
    setNewTodo({...newTodo,[event.target.name]:event.target.value})
  }
  const handleFormSubmit=async(e:any)=>{
    try {
       const response=await axios.post("http://localhost:9363/grup/panel",{
        ...newTodo
       })
       if(response.status===200){
        setNewTodo({
          kullaniciAd:"",
          group:"",
          is:""
        })
      } else {
        console.error(
          "Failed to make POST request. Server responded with status:",
          response.status
        );
      }
    } catch (error) {
      console.log(error);
    }
  };
  const [open, setOpen] = useState(false);

  const cancelButtonRef = useRef(null);
  const [data, setData] = useState<TodoType[]>([]);

  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:9363/grup/panel");
      setData(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchData();
  }, []);
  const Group = [
    { group: "A Group" },
    { group: "B Group" },
    { group: "C Group" },
    { group: "D Group" },
  ];
  const Work = [
    { work: "Electronic Care" },
    { work: "Forklif" },
    { work: "Machine Care" },

  ];
  return (
    <>
      <div className="grid gap-3  md:grid-cols-3">
        <ul className="list-disc">
          <li>
            Now this is a story all about how, my life got flipped-turned upside
            down
          </li>
          <li>
            Now this is a story all about how, my life got flipped-turned upside
            down
          </li>
          <li>
            Now this is a story all about how, my life got flipped-turned upside
            down
          </li>
        </ul>

        <ol className="list-decimal">
          <li>
            Now this is a story all about how, my life got flipped-turned upside
            down
          </li>
        </ol>

        <ul className="list-none pr-3">
          <ul role="list" className="divide-y divide-gray-700">
            {data.map((item) => (
              <li className="flex justify-between gap-x-6 py-5">
                <div className="flex min-w-0 gap-x-4">
                  <img
                    className="h-12 w-12 flex-none rounded-full bg-gray-50"
                    src="User-avatar.svg.png"
                    alt=""
                    onClick={() => setOpen(true)}
                  />

                  <div className="min-w-0 flex-auto">
                    <p className="text-sm font-semibold leading-6 text-gray-100">
                      {item.kullaniciAd}
                    </p>
                  </div>
                </div>
              </li>
            ))}
          </ul>
        </ul>
      </div>
      <Transition.Root show={open}>
        <Dialog
          as="div"
          className="relative z-10"
          initialFocus={cancelButtonRef}
          onClose={setOpen}
        >
          <Transition.Child
            enter="ease-out duration-300"
            enterFrom="opacity-0"
            enterTo="opacity-100"
            leave="ease-in duration-200"
            leaveFrom="opacity-100"
            leaveTo="opacity-0"
          >
            <div className="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity" />
          </Transition.Child>

          <div className="fixed inset-0 z-10 w-screen overflow-y-auto">
            <div className="flex min-h-full items-end justify-center p-4 text-center sm:items-center sm:p-0">
              <Transition.Child
                enter="ease-out duration-300"
                enterFrom="opacity-0 translate-y-4 sm:translate-y-0 sm:scale-95"
                enterTo="opacity-100 translate-y-0 sm:scale-100"
                leave="ease-in duration-200"
                leaveFrom="opacity-100 translate-y-0 sm:scale-100"
                leaveTo="opacity-0 translate-y-4 sm:translate-y-0 sm:scale-95"
              >
                <Dialog.Panel className="relative transform overflow-hidden rounded-lg bg-gray-800 text-left shadow-xl transition-all sm:my-8 sm:w-full sm:max-w-lg">
                  <div className="bg-gra-800 px-4 pb-4 pt-5 sm:p-6 sm:pb-4">
                    <div className="sm:flex sm:items-start">
                      <div className="mx-auto flex h-12 w-12 flex-shrink-0 items-center justify-center rounded-full bg-red-100 sm:mx-0 sm:h-10 sm:w-10">
                        <ExclamationTriangleIcon
                          className="h-6 w-6 text-red-600"
                          aria-hidden="true"
                        />
                      </div>
                      <div className="mt-3 text-center sm:ml-4 sm:mt-0 sm:text-left">
                        <Dialog.Title
                          as="h3"
                          className="text-base font-semibold leading-6 text-gray-900"
                        >
                          User Grouping
                        </Dialog.Title>
                        <div className="mt-2">
                          <form onSubmit={handleFormSubmit}>
                            <div className="space-y-12">
                              <div className="border-b border-gray-900/10 pb-12 ">
                                <p className="mt-1 text-sm leading-6 text-white">
                                  Add user workgroups and user mappings.
                                </p>

                                <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
                                  <div className="sm:col-span-7">

                                    <div >
                                      <select
                                        id="country"
                                        name="group"
                                        autoComplete="country-name"
                                        className="pl-1 block w-full rounded-md border-0 py-1.5 text-gray shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                                        value={newTodo.group}
                                        onChange={handleInputChange}
                                      >
                                        <option value="United States">
                                          Items
                                        </option>
                                        {data.map((item, index) => {
                                          return (
                                            <option key={index} value={item.group}>
                                              {item.group}
                                            </option>
                                          );
                                        })}
                                      </select>
                                    </div>
                                  </div>
                                  <div className="sm:col-span-7">

                                    <div >
                                      <select
                                        id="country"
                                        name="kullaniciAd"
                                        autoComplete="country-name"
                                        className="pl-1 block w-full rounded-md border-0 py-1.5 text-gray shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
